import React from 'react';

import { LinkContainer } from 'react-router-bootstrap';
const Footer = () => {
  return (
    <footer>
      <LinkContainer to='/' className='footer'>
        Telegram
      </LinkContainer>
    </footer>
  );
};

export default Footer;
